<script>
    
    import { base } from '$app/paths';
    import {users_store} from "$lib/user";
    import { onMount } from 'svelte';
    
    onMount(() => {
        /*Check if has more then 2 characters*/
        if($users_store.length > 2){
            users = JSON.parse($users_store);
        }
    });



    let users = [];


    



    
    let color = "black"
    let name = ""
    let Email = ""
    let password = ""

    let colors = [
        {namn: "Röd", value: "red"}, 
        {namn: "Orange", value: "orange"},
        {namn: "Gul", value: "yellow"},
        {namn: "Grön", value: "green"},
        {namn: "Turkos", value: "turquoise"},
        {namn: "Blå", value: "blue"},
        {namn: "Lila", value: "purple"},
        {namn: "Rosa", value: "pink"},
    ]

    function handleSubmit(){
        
        if (name && Email && password) {
            
            if (users.filter(users => users.username === name).length > 0) {
                alert("Den här användaren finns redan!")
            } else {
                alert("Välkommen, \n" + "\n"+ name + "\n" + Email + "\n" + password + "\n" + color)
                let new_user = {username: name, password: password, email: Email, color: color};
                users = [...users, new_user];
                $users_store = JSON.stringify(users);
            }
        } else {
            alert("Fyll i alla fällt tack!")
        }
        
        
        
    }
</script>


<main>
    <div class="container">
        <h1>
            <strong>Registrering</strong>
        </h1>
        
        <div style="width: 100px; height: 100px; border: 4px solid; border-radius: 50%; overflow:hidden; background-color:{color};"></div>

        <form on:submit|preventDefault={handleSubmit}>
            
            <label for="name">Namn:</label>
            <input type="text" bind:value = {name} >

            
            <label for="E-post">E-post:</label>
            <input type="text" bind:value = {Email} >


            <label for="Lösen">Lösenord:</label>
            <input type="password" bind:value = {password}>

            <label for="Favoritfärg">Favoritfärg</label>
            <select id="Favoritfärg" bind:value = {color}>
                {#each colors as c} 
                    <option value={c.value}>{c.namn}</option>
                {/each}
            </select>
            <input type="submit" value="Registrera">
        </form>
        <h2>Har du redan ett konto? <a href="{base}/Login"> Logga in!</a></h2>
    </div>
</main>


